import Preview from './Preview';

const Prewvies = ({ tetrominoes }) => {
    const previewTetrominoes = tetrominoes
    .slice(1 - tetrominoes)
    .reverse();

    return (
        <>
        {previewTetrominoes.map((tetromino, index) => (
            <Preview tetromino={tetromino} index={index} key={index} />
        ))}
        </>
    )
}

export default Preview
